from tqdm import tqdm
def crawler(url):    
    if url.endswith('.pdf'):
        return pdf(url)   
    if url.endswith('.xlsx'):
        # unable to handle excel file
        content = {}
        content['head'] = 'crawler not supported'
        content['body'] = 'crawler not supported'
        content['post_body'] = 'crawler not supported'

        return content
    
    web_content = ''
    try:
      response = requests.get(url,timeout = 10, verify = False)
      if response.status_code >= 400:
        web_content = 'crawler not supported'
      else:
        web_content = response.text
    except:
      web_content = 'crawler not supported'

    doc = Document(web_content)
    
    title = doc.title()
    
    summary = doc.summary()
    body = html2text.html2text(summary).replace("\n"," ")
    links = (re.findall(r'(https?://\S+)',body))
    #to remove links and punctuations
    for i in links:
        post_body = body.replace(i," ")
    post_body = re.sub('['+string.punctuation+']',' ', body)
    
    content = {}
    content['head'] = title
    content['body'] = html2text.html2text(body)
    content['post_body'] = post_body

    
    return content


def pdf(file_url):
    
    data = requests.get(file_url)
    temp = extractPdfText(BytesIO(data.content))
    content = {}
    content['head'] = ''
    content['body'] = temp
    content['post_body'] = temp 

    return content


def extractPdfText(fileObject):

    text = ''

    try:
        # Create a pdf reader .
        pdfFileReader = PyPDF2.PdfFileReader(fileObject)

        # Get total pdf page number.
        totalPageNumber = pdfFileReader.numPages

        # Print pdf total page number.
        print('This pdf file contains totally ' + str(totalPageNumber) + ' pages.')

        currentPageNumber = 0
        

        # Loop in all the pdf pages.
        while(currentPageNumber < totalPageNumber ):

            # Get the specified pdf page object.
            pdfPage = pdfFileReader.getPage(currentPageNumber)

            # Get pdf page text.
            text = text + pdfPage.extractText()

            # Process next page.
            currentPageNumber += 1

    except: 
        print("Error in reading the pdf...")
       
    return text

def cosine_sim(texts): #the texts must be in a list
      vectorizer = TfidfVectorizer(stop_words="english",min_df=1)
      tfidf = vectorizer.fit_transform(texts)
      return ((tfidf * tfidf.T).A)

def fake_news_detect(url,fake_news = fake_news, news = news):
  #### google search the title
  query = crawler(url)['head']

  search_result = [url]
  for j in search(query, tld="com", stop=15, pause=3):
      search_result = search_result+[j]

  if query == '[no-title]':
    print('crawler not supported')

  res_header = []
  res_body = []
  # for i in tqdm(search_result):
  #     res.append(crawler(i)[0])
  for i in tqdm(search_result):
      res_header.append(crawler(i)['head'])
      res_body.append(crawler(i)['post_body'])
  
  vectorizer = TfidfVectorizer(stop_words="english",min_df=1)

  
  messages = res_header
  corr = cosine_sim(messages)
  #suggestion: >0.7 consider as correlated
  #remember to include NER and Sentiment
  search_result = np.array(search_result)
  #find out the list of url that is correlated
  # cor_news = search_result[corr[0]>0.4]
  cor_news = search_result[corr[0]>0.4]
  cor_news_domain = []
  for i in cor_news:
    cor_news_domain.append(i.split('/')[2])

  domain_in_news = []
  domain_in_fakenews = []
  for i in cor_news:
    if i.split('/')[2].replace('www.',"") in news:
      domain_in_news.append(i.split('/')[2])
  for i in cor_news:
    if i.split('/')[2].replace('www.',"") in fake_news or i.find('theonion.com') != -1:
      domain_in_fakenews.append(i.split('/')[2])
  score = len((domain_in_news))*1.5 + len(set(cor_news_domain)-set(domain_in_news)-set(domain_in_fakenews))*0.5 - len((domain_in_fakenews))*2
  if score <3.0:
    return 0,score,cor_news
  else: return 1,score,cor_news
